//   '',\n    //   ErrorInterceptor.snackBarConfig\n    // );\n    console.error(`Backend Error ! status: ${status}, error: ${error}, message: ${message}`);\n\n    return throwError(errorRes);\n  }\n                        \n                    \n                        \n                            \n                                    Defined in apps/default/src/app/core/interceptors/error.interceptor.ts:19\n                            \n                        \n\n\n            \n        \n\n\n    \n\n\n    \n        import { Injectable, Injector } from '@angular/core';\nimport { HttpEvent, HttpInterceptor, HttpHandler, HttpRequest, HttpErrorResponse } from '@angular/common/http';\nimport { Observable, throwError } from 'rxjs';\nimport { catchError } from 'rxjs/operators';\n// import { Store } from '@ngxs/store';\n// import { MatSnackBar, MatSnackBarConfig } from '@angular/material';\n\n@Injectable()\nexport class ErrorInterceptor implements HttpInterceptor {\n  // static snackBarConfig: MatSnackBarConfig = {\n  //   duration: 10000\n  // };\n  constructor(/*private snackBar: MatSnackBar, private store : Store*/) {}\n\n  intercept(req: HttpRequest, next: HttpHandler): Observable> {\n    return next.handle(req).pipe(catchError(this.handleError));\n  }\n\n  public handleError = (errorRes: HttpErrorResponse) => {\n    const {\n      error: { status, error, message }\n    } = errorRes;\n    // Do messaging and error handling here\n    // this.snackBar.open(\n    //   `Error ! ${message}`,\n    //   '',\n    //   ErrorInterceptor.snackBarConfig\n    // );\n    console.error(`Backend Error ! status: ${status}, error: ${error}, message: ${message}`);\n\n    return throwError(errorRes);\n  };\n}\n\n    \n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"injectables/EventBus.html":{"url":"injectables/EventBus.html","title":"injectable - EventBus","body":"\n                   \n\n\n\n\n\n\n\n  Injectables\n  EventBus\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            apps/default/src/app/core/state/eventbus.ts\n        \n\n\n\n\n            \n    Constructor\n        \n            \n                \n                    \nconstructor(actions$: Actions)\n                    \n                \n                        \n                            \n                                Defined in apps/default/src/app/core/state/eventbus.ts:6\n                            \n                        \n\n                \n                    \n                            \n                                    Parameters :\n                                    \n                                        \n                                            \n                                                Name\n                                                    Type\n                                                Optional\n                                            \n                                        \n                                        \n                                                \n                                                    actions$\n                                                  \n                                                        \n                                                                    Actions\n                                                        \n                                                  \n                                                    \n                                                            no\n                                                    \n                                                    \n                                                \n                                        \n                                    \n                            \n                    \n                \n            \n        \n\n\n\n\n    \n\n\n    \n        import { Actions, ofActionCompleted, ofActionErrored, ofActionDispatched } from '@ngxs/store';\nimport { Injectable } from '@angular/core';\nimport { Login } from '@nx-starter-kit/auth';\n\n@Injectable()\nexport class EventBus {\n  constructor(private actions$: Actions) {\n    this.actions$.pipe(ofActionDispatched(Login)).subscribe(action => console.log('Login.......Action Dispatched'));\n    this.actions$.pipe(ofActionCompleted(Login)).subscribe(action => console.log('Login........Action Completed'));\n    this.actions$.pipe(ofActionErrored(Login)).subscribe(action => console.log('Login........Action Errored'));\n  }\n}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"modules/ExperimentsModule.html":{"url":"modules/ExperimentsModule.html","title":"module - ExperimentsModule","body":"\n                   \n\n\n\n\n  Modules\n  ExperimentsModule\n\n\n      \n          \n              \n\n\n\n\n\ndependencies\n\nLegend\n\n  Declarations\n\n  Module\n\n  Bootstrap\n\n  Providers\n\n  Exports\n\ncluster_ExperimentsModule\n\n\n\ncluster_ExperimentsModule_declarations\n\n\n\ncluster_ExperimentsModule_imports\n\n\n\n\nAnimationsComponent\n\nAnimationsComponent\n\n\n\nExperimentsModule\n\nExperimentsModule\n\nExperimentsModule -->\n\nAnimationsComponent->ExperimentsModule\n\n\n\n\n\nFileUploadComponent\n\nFileUploadComponent\n\nExperimentsModule -->\n\nFileUploadComponent->ExperimentsModule\n\n\n\n\n\nHammertimeDirective\n\nHammertimeDirective\n\nExperimentsModule -->\n\nHammertimeDirective->ExperimentsModule\n\n\n\n\n\nSharedModule\n\nSharedModule\n\nExperimentsModule -->\n\nSharedModule->ExperimentsModule\n\n\n\n\n\nUploadModule\n\nUploadModule\n\nExperimentsModule -->\n\nUploadModule->ExperimentsModule\n\n\n\n\n\n\n          \n          \n          \n              Zoom in\n              Reset\n              Zoom out\n          \n      \n      \n      \n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n\n        \n            File\n        \n        \n            libs/experiments/src/experiments.module.ts\n        \n\n\n        \n\n        \n            \n                \n                    Declarations\n                    \n                            \n                                AnimationsComponent\n                            \n                            \n                                FileUploadComponent\n                            \n                            \n                                HammertimeDirective\n                            \n                    \n                \n                \n                    Imports\n                    \n                            \n                                    SharedModule\n                            \n                            \n                                    UploadModule\n                            \n                    \n                \n            \n        \n    \n\n\n    \n        import { NgModule } from '@angular/core';\nimport { RouterModule } from '@angular/router';\nimport * as Hammer from 'hammerjs';\nimport { HammerGestureConfig, HAMMER_GESTURE_CONFIG } from '@angular/platform-browser';\nimport { FilePondModule,registerPlugin } from '@xmlking/ngx-filepond';\n\nimport { SharedModule } from '@nx-starter-kit/shared';\nimport { UploadModule } from '@nx-starter-kit/upload';\nimport { AnimationsComponent } from './containers/animations/animations.component';\nimport { FileUploadComponent } from './containers/file-upload/file-upload.component';\nimport { HammertimeDirective } from './components/hammertime/hammertime.directive';\n\nexport class MyHammerConfig extends HammerGestureConfig {\n  overrides = {\n    // override hammerjs default configuration\n    swipe: { direction: Hammer.DIRECTION_ALL }\n  };\n}\n\n// Registering plugins\nimport * as FilePondPluginFileValidateType from 'filepond-plugin-file-validate-type';\nimport * as FilepondPluginFileValidateSize from 'filepond-plugin-file-validate-size';\nimport * as FilepondPluginImagePreview from 'filepond-plugin-image-preview';\n\nregisterPlugin(FilePondPluginFileValidateType, FilepondPluginFileValidateSize, FilepondPluginImagePreview);\n\n@NgModule({\n  imports: [\n    SharedModule,\n    UploadModule,\n    FilePondModule,\n    RouterModule.forChild([\n      /* {path: '', pathMatch: 'full', component: InsertYourComponentHere} */\n      { path: '', redirectTo: 'animations', pathMatch: 'full', data: { animation: 'experiments' } },\n      {\n        path: 'animations',\n        component: AnimationsComponent,\n        data: { animations: 'animations' }\n      },\n      {\n        path: 'file-upload',\n        component: FileUploadComponent,\n        data: { animation: 'file-upload' }\n      },\n      {\n        path: 'experiment3',\n        component: AnimationsComponent,\n        data: { animation: 'experiment3' }\n      }\n    ])\n  ],\n  providers: [\n    {\n      provide: HAMMER_GESTURE_CONFIG,\n      useClass: MyHammerConfig\n    }\n  ],\n  declarations: [AnimationsComponent, FileUploadComponent, HammertimeDirective]\n})\nexport class ExperimentsModule {}\n\n    \n\n\n\n\n\n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"interfaces/Filter.html":{"url":"interfaces/Filter.html","title":"interface - Filter","body":"\n                   \n\n\n\n\n\n\n\n\n\n\n\n  Interfaces\n  Filter\n\n\n\n    \n        Info\n    \n\n\n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            libs/shared/src/containers/entity/entity.service.ts\n        \n\n\n\n\n\n            \n    Indexable\n        \n            \n                \n                    \n                        [name: string]:    string | []\n\n                    \n                \n                        \n                            \n                                Defined in libs/shared/src/containers/entity/entity.service.ts:8\n                            \n                        \n            \n        \n\n\n    \n\n\n    \n        import { HttpClient, HttpErrorResponse, HttpParams } from '@angular/common/http';\nimport { Observable, BehaviorSubject, throwError } from 'rxjs';\nimport { environment } from '@env/environment';\nimport { Entity } from './entity.model';\nimport { map, retry, catchError, finalize } from 'rxjs/operators';\nimport * as moment from 'moment';\n\nexport interface Filter {\n  [name: string]: string | string[];\n}\n\nexport abstract class EntityService {\n  protected readonly baseUrl = environment.API_BASE_URL;\n  protected loadingSubject = new BehaviorSubject(false);\n  public loading$ = this.loadingSubject.asObservable();\n\n  protected abstract entityPath: string;\n\n  constructor(protected httpClient: HttpClient) {}\n\n  getById(id: number) {\n    this.loadingSubject.next(true);\n    return this.httpClient\n      .get(`${this.baseUrl}/${this.entityPath}/${id}`)\n      .pipe(catchError(this.handleError), finalize(() => this.loadingSubject.next(false)));\n  }\n\n  findAll(filter: Filter, sortOrder = 'asc', pageNumber = 0, pageSize = 100): Observable | Observable {\n    this.loadingSubject.next(true);\n    return this.httpClient\n      .get(`${this.baseUrl}/${this.entityPath}`, {\n        params: new HttpParams()\n          .set('filter', 'filter TODO')\n          .set('sortOrder', sortOrder)\n          .set('pageNumber', pageNumber.toString())\n          .set('pageSize', pageSize.toString())\n      })\n      .pipe(\n        retry(3), // retry a failed request up to 3 times\n        catchError(this.handleError),\n        finalize(() => this.loadingSubject.next(false))\n      );\n  }\n\n  getAll(): Observable {\n    this.loadingSubject.next(true);\n    return this.httpClient.get(`${this.baseUrl}/${this.entityPath}`).pipe(\n      retry(3), // retry a failed request up to 3 times\n      catchError(this.handleError),\n      finalize(() => this.loadingSubject.next(false))\n    );\n  }\n\n  delete(id: number | string) {\n    this.loadingSubject.next(true);\n    return this.httpClient\n      .delete(`${this.baseUrl}/${this.entityPath}/${id}`)\n      .pipe(catchError(this.handleError), finalize(() => this.loadingSubject.next(false)));\n  }\n\n  post(entity: T) {\n    this.loadingSubject.next(true);\n    return this.httpClient\n      .post(`${this.baseUrl}/${this.entityPath}`, entity)\n      .pipe(catchError(this.handleError), finalize(() => this.loadingSubject.next(false)));\n  }\n\n  put(entity: T) {\n    console.log(entity);\n    this.loadingSubject.next(true);\n    return this.httpClient\n      .put(`${this.baseUrl}/${this.entityPath}`, entity)\n      .pipe(catchError(this.handleError), finalize(() => this.loadingSubject.next(false)));\n  }\n\n  protected handleError(error: HttpErrorResponse) {\n    if (error.error instanceof ErrorEvent) {\n      // A client-side or network error occurred. Handle it accordingly.\n      console.error('An error occurred:', error.error.message);\n    } else {\n      // The backend returned an unsuccessful response code.\n      // The response body may contain clues as to what went wrong,\n      console.error(`Backend returned code ${error.status}, ` + `body was: ${error.error}`);\n    }\n    // return an ErrorObservable with a user-facing error message\n    return throwError('Something bad happened; please try again later.');\n  }\n\n  protected convertToJson(body: any) {\n    const temporalFunctionToJson = Date.prototype.toJSON;\n    Date.prototype.toJSON = function() {\n      return moment(this).format('YYYY-MM-DD');\n    };\n\n    const jsonBody = JSON.stringify(body);\n\n    Date.prototype.toJSON = temporalFunctionToJson;\n    return jsonBody;\n  }\n}\n\n    \n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n   